import React from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const ViewUserList = ({ userInfo, handleLogout }) => {
    const location = useLocation();
    // Check if location.state and dataItem exist
    const dataItem = location.state?.dataItem;    
    // alert(dataItem)
    const navigate = useNavigate();

    const handleBack = () => {
        navigate('/superadmin/ManageUsers');
    };

    const gridContainerStyle = {
        display: 'grid',
        gridTemplateColumns: 'repeat(4, 1fr)',
        gridGap: '10px',
        padding: '10px',
      };

    const gridItemStyle = {
        padding: '10px',
        fontWeight: 'bold',
    };

     // Timestamp data 
    function formatTimestamp(originalTimestamp) {
        const date = new Date(originalTimestamp);
        const day = String(date.getDate()).padStart(2, '0');
        const month = String(date.getMonth() + 1).padStart(2, '0');
        const year = date.getFullYear();

        let hours = date.getHours();
        const minutes = String(date.getMinutes()).padStart(2, '0');
        const seconds = String(date.getSeconds()).padStart(2, '0');
        const ampm = hours >= 12 ? 'PM' : 'AM';
        hours = hours % 12;
        hours = hours ? hours : 12; // the hour '0' should be '12'
        hours = String(hours).padStart(2, '0');

        const formattedDate = `${day}/${month}/${year} ${hours}:${minutes}:${seconds} ${ampm}`;
        return formattedDate;
    } 


    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout} />
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Manage User's</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={handleBack}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div className="row">
                                            <div className="col-md-12 grid-margin">
                                                <div className="row">
                                                    <div className="col-12 col-xl-12">
                                                        <div style={{textAlign:'center'}}>
                                                            <h4 className="card-title" style={{paddingTop:'10px'}}>User all list</h4>  
                                                            <hr></hr>
                                                        </div>
                                                    </div>
                                                    <div style={gridContainerStyle}>
                                                        <div style={gridItemStyle}>User Name: <span style={{fontWeight:'normal'}}>Spark Minda</span></div>
                                                        <div style={gridItemStyle}>Email Id: <span style={{fontWeight:'normal'}}>sparkminda.gamil.com</span></div>   
                                                        <div style={gridItemStyle}>Phone Number: <span style={{fontWeight:'normal'}}>9087654312</span></div> 
                                                        <div style={gridItemStyle}>Password: <span style={{fontWeight:'normal'}}>123456789</span></div>   
                                                        <div style={gridItemStyle}>Wallet Balance: <span style={{fontWeight:'normal'}}>Rs. 1000</span></div>
                                                        <div style={gridItemStyle}>Role: <span style={{fontWeight:'normal'}}>SuperAdmin</span></div>
                                                        <div style={gridItemStyle}>Assigned Reseller: <span style={{fontWeight:'normal'}}>Admin</span></div>
                                                        <div style={gridItemStyle}>Assigned Client: <span style={{fontWeight:'normal'}}>Admin</span></div>
                                                        <div style={gridItemStyle}>Assigned Association: <span style={{fontWeight:'normal'}}>Admin</span></div>
                                                        <div style={gridItemStyle}>Created By: <span style={{fontWeight:'normal'}}>sparkminda</span></div> 
                                                        <div style={gridItemStyle}>Created Date: <span style={{fontWeight:'normal'}}>21/06/2024</span></div>   
                                                        <div style={gridItemStyle}>Modified By: <span style={{fontWeight:'normal'}}>sparkminda</span></div>
                                                        <div style={gridItemStyle}>Modified Date: <span style={{fontWeight:'normal'}}>21/06/2024</span></div>
                                                        <div style={gridItemStyle}>Status: <span style={{fontWeight:'normal'}}>UID0009</span></div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>

                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    )
}   

export default ViewUserList
